import React from 'react';
import PropTypes from 'prop-types';
import { Route, Redirect } from 'react-router-dom';
import { withStyles } from '@material-ui/core/styles';
// import WithMainNav from './with-main-nav';



const styles = theme => ({
  container: {
    minHeight: '100vh',
    position: 'relative',
  },
  footer: {
    position: 'absolute',
    textAlign: 'center',
    backgroundColor: '#f7f7f7',
    bottom: '-100px',
    [theme.breakpoints.down('sm')]: {
      width: '100%',
      marginLeft: '0',
    },
    [theme.breakpoints.up('md')]: {
      width: `calc(100% - ${theme.leftDrawerWidth}px)`,
      marginLeft: theme.leftDrawerWidth,
    },
  },
  partner: {
    width: '10%',
    minWidth: '150px',
    maxWidth: '200px',
  },
});


/* eslint-disable react/destructuring-assignment */
const WrappedRoute = ({
  path,
  exact,
  component: Component,
  mainNav,
  classes,
  adminOnly,
  ...props
}) => {
  return (
    <Route
      exact={!!exact}
      path={path}
      render={(routeProps) => {

        return (
          <div className={classes.container}>
            <Component {...props} {...routeProps} />
          </div>
        );
      }}
    />
  );
};


// WrappedRoute.propTypes = {
// };


// WrappedRoute.defaultProps = {

// };


export default withStyles(styles)(WrappedRoute);
